import React from "react";

const ConsolidationTable2 = ({ 
  acciones, 
  preciosActuales = {} // Optional prop for current market prices
}) => {
  // Group stocks by name and calculate totals
  const groupByAccion = () => {
    const grouped = {};

    acciones.forEach((accion) => {
      if (!grouped[accion.nombre]) {
        grouped[accion.nombre] = {
          nombre: accion.nombre,
          totalCantidad: 0,
          totalInvertido: 0,
          transacciones: []
        };
      }
      
      const grupo = grouped[accion.nombre];
      grupo.totalCantidad += accion.numeroAcciones || 0;
      grupo.totalInvertido += (accion.valor || 0) * (accion.numeroAcciones || 0);
      grupo.transacciones.push({
        fechaCompra: accion.fechaCompra,
        valor: accion.valor,
        numeroAcciones: accion.numeroAcciones
      });
    });

    return Object.values(grouped);
  };

  const calculateMetrics = (accion) => {
    const precioActual = preciosActuales[accion.nombre] || 
      // Fallback calculation if no current price provided
      (accion.totalInvertido / accion.totalCantidad);

    const precioCostoPromedio = accion.totalInvertido / accion.totalCantidad;
    
    const valorActualTotal = precioActual * accion.totalCantidad;
    const gananciaPerdidaUSD = valorActualTotal - accion.totalInvertido;
    const gananciaPercentage = (gananciaPerdidaUSD / accion.totalInvertido) * 100;

    return {
      totalCantidad: accion.totalCantidad,
      totalInvertido: accion.totalInvertido.toFixed(2),
      precioCostoPromedio: precioCostoPromedio.toFixed(2),
      precioActual: precioActual.toFixed(2),
      valorActualTotal: valorActualTotal.toFixed(2),
      gananciaPerdidaUSD: gananciaPerdidaUSD.toFixed(2),
      gananciaPercentage: gananciaPercentage.toFixed(2)
    };
  };

  const accionesAgrupadas = groupByAccion();

  return (
    <div className="mt-8 p-6 bg-white rounded-lg shadow-lg">
      <h2 className="text-xl font-bold mb-4">Consolidación de Acciones</h2>
      <div className="overflow-x-auto">
        <table className="w-full border-collapse">
          <thead>
            <tr className="bg-gray-50">
              <th className="border p-2 text-left">ACCIÓN</th>
              <th className="border p-2 text-right">CANTIDAD</th>
              <th className="border p-2 text-right">TOTAL INVERTIDO</th>
              <th className="border p-2 text-right">PRECIO COSTO PROM.</th>
              <th className="border p-2 text-right">PRECIO ACTUAL</th>
              <th className="border p-2 text-right">VALOR ACTUAL</th>
              <th className="border p-2 text-right">$GANANCIA/PÉRDIDA</th>
              <th className="border p-2 text-right">%GANANCIA/PÉRDIDA</th>
            </tr>
          </thead>
          <tbody>
            {accionesAgrupadas.map((accion, index) => {
              const metrics = calculateMetrics(accion);
              const isGanancia = metrics.gananciaPerdidaUSD >= 0;

              return (
                <tr 
                  key={index} 
                  className={`hover:bg-gray-50 ${
                    isGanancia 
                      ? 'text-green-700' 
                      : 'text-red-700'
                  }`}
                >
                  <td className="border p-2">{accion.nombre}</td>
                  <td className="border p-2 text-right">{metrics.totalCantidad}</td>
                  <td className="border p-2 text-right">${metrics.totalInvertido}</td>
                  <td className="border p-2 text-right">${metrics.precioCostoPromedio}</td>
                  <td className="border p-2 text-right">${metrics.precioActual}</td>
                  <td className="border p-2 text-right">${metrics.valorActualTotal}</td>
                  <td className="border p-2 text-right">${metrics.gananciaPerdidaUSD}</td>
                  <td className="border p-2 text-right">{metrics.gananciaPercentage}%</td>
                </tr>
              );
            })}
          </tbody>
        </table>
      </div>
    </div>
  );
};

export default ConsolidationTable2;
